import Expenseltem from "./components/ExpenseItem";

function App() {
  const expenses = [
    { title: "Car Insuranse", amount: 294.67, date: new Date(2021, 2, 28) },
  ];

  return (
    <>
      <h2>Let's get started!</h2>
      <Expenseltem
        date={expenses[0].date}
        title={expenses[0].title}
        amount={expenses[0].amount}
      />
    </>
  );
}

export default App;
